import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <Layout>
                <Head>
                    <title>Inicio</title>
                </Head>         
            </Layout>
            <h1>Home</h1> 
        <style jsx>{`
            *{
                height: 80vh;
                width: 100%;
                background-color: #917C5DFF;
            }
            body{
                background-color: red;
            }
        `}</style>
        </>
    )
}
export default Home;
